column8:
1足1足、熟練の職人さんに丁寧に作っていただいたメイド・イン・ジャパンのフラットシューズ。ハンドメイドのあたたかみと品質のよさが感じられるスペシャルな１足です。
シンプルで安定感のあるストラップ付きフラットシューズに幅広の方やソックスを履いてゆったり履きたい方向けの4Eタイプが登場しました。2素材全11色の豊富なバリエーションからお選びいただけます。
<br><br>

大きいサイズ対応
<br>23.0cm/23.5cm/24.0cm/24.5cm/25.0cm/25.5cm/26cm







